import React from 'react';
import "./home.css";

const Home = () => {
  return (
    <div className='homebg'> <br/>
      <div className='book_consulatation text-center p-5'>
        <h5 className='font-weight-bold'> Developing Innovative Strategies </h5>
        <h1 className='font-weight-bold mt-4 display-3'> ACHIEVING GROWTH </h1>
      </div>
    </div>
  )
}

export default Home;
